import React from 'react'
import { useState } from 'react';
import { Typography, AppBar, Toolbar, CssBaseline, Box, Button } from '@mui/material'


const Header = () => {

  const pages = {'My Portfolio': 'https://www.google.com/', 'My Github': 'https://github.com/dnnysoftware'};
  const [anchorElNav, setAnchorElNav] = useState(null);

  const handleCloseNavMenu = () => {
    setAnchorElNav(null);
  };

  const handleOpenNavMenu = (event) => {
    setAnchorElNav(event.currentTarget);
  };


  return (
      <CssBaseline>
        <AppBar position='relative'>
          <Toolbar>
            <Typography variant='h1'>Daniel's Translator Web App</Typography>
            <Box sx={{ flexGrow: 1, display: { xs: 'none', md: 'flex' } }}>
            {pages.map((page) => (
              <Button
                key={page}
                onClick={handleCloseNavMenu}
                sx={{ my: 2, color: 'white', display: 'block' }}
                href='https://github.com/dnnysoftware'
              >
                {page}
              </Button>
            ))}
          </Box>
          </Toolbar>
        </AppBar>
      </CssBaseline>
  )
}

export default Header
